        [color=orange][bold]КНИГА ПРИЗРАКОВ:[/bold][/color]                                                                     [italic](если хотите выбрать призрака, то возле него ставьте +)[/italic]                                                                                                                                                                            [color=red][bold]ПОЛТЕРГЕЙСТ:[/bold][/color]                                                                                   [italic]взаимодействует с окружением, можно услышать с помощью радиоприёмника, записи в блокноте, может явиться в виде материального тела, изгоняется с помощью распятия.[/italic]                                                                                                                                            [color=red] [bold]МАРА:[/bold][/color]                                                                                                   [italic]частая охота, включает/выключает свет, можно услышать с помошью радиоприемника, призрачный огонёк, изгоняется с помощью распятия.[/italic]                                                                                                      [color=red][bold]ДУХ:[/bold][/color]                                                                                                       [italic]издает сильные звуки, записи в блокноте, является в виде материального тела, изгоняется с помощью благовония.[/italic]                                                                              [color=red][bold]МИРАЖ:[/bold][/color]                                                                                             [italic]следы на соли, можно заметить с помощью  проектора, может менять комнату, в которой находится игрок, является в виде материального тела, изгоняется с помощью благовония.[/italic]                                               [color=red][bold]МРЭЙ:[/bold][/color]                                                                                                         [italic]следы на соли, включает/выключает свет, записи в блокноте, НЕ ОХОТИТЬСЯ, взаимодействует с окружением, НЕ ИЗГОНЯЕТЬСЯ, может показывать призраков прошлого.[/italic]                                                                            [color=red][bold]МИМИК:[/bold][/color]                                                                                                     [italic]Умеет копировать повадки других призраков, также умеет вселяться в одушевлённые и не одушевлённые объекты, является в виде материального тела, можно изгнать с помощью благовония.[/italic]                                                                                    [color=red][bold]СКИФ:[/bold][/color]                                                                                                               [italic]частая охота, записи в блокноте, можно услышать с помощью радиоприёмника, умеет материлизовывать неодушевлённые предметы, является в виде материального тела, ДОВОЛЬНО РАЗГОВОРЧИВ, изгоняется с помощью распятия.[/italic]
